/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react'
import { Box } from '@material-ui/core'
import { Link } from 'react-router-dom'
import blue from '@material-ui/core/colors/blue'
import { connect } from 'react-redux' 
import '../scss/style.scss'
import { UserType } from '../types'


const Header: React.FC<{}> = ({ user, isLoading }) => {

    if(isLoading) {
        return "Loading..."
    }
    console.log("User", user)
    const auth = (
                <Box display="flex" alignContent="center" >
                    <Link to="/register">
                        <Box>Register</Box>
                    </Link>
                    <Box ml={4}>
                        <Link to="/login" >
                            <Box>Login</Box>
                        </Link>
                    </Box>
                </Box>
    )
    const profile = (
        <Box display="flex" alignContent="center" >                   
                <Box>"user</Box>                  
                <Box ml={4}>                         
                    Logout
                </Box>
        </Box>
    )
    return (
        <Box bgcolor={blue[500]} width='100%' height="150px" color="text.primary">
            <Box className="container" display="flex" alignItems="center" justifyContent="space-between">      
                <Box className="container__logo">
                    <Link to="/">
                         <img src="morimage.png" alt="Logo" />
                    </Link>
                </Box>
                { user ? profile : auth}

            </Box>
        </Box>
    )
}

function mapStateToProps(state) {
    console.log("mapStateToProps",state)
    return {
       user: state.userReducer.data,
       isLoading: state.userReducer.isLoading
    }
   }

export default connect(mapStateToProps)(Header)
